import React from 'react';
import classes from '../../../../../Css/DrawerToggle.module.css'

const DrawerToggle = (props) => (
    <div className={classes.DrawerToggle} onClick={props.click}>
        <div></div>
        <div></div>
        <div></div>
    </div>
);

export default DrawerToggle;
